import React from "react";
import { Text, View, StyleSheet, Button, SafeAreaView } from "react-native";

const LifeWithHypsiesScreen = ({ navigation }) => {
  return (
    <SafeAreaView>
      <View>
        <Text>Life With Hypsies</Text>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({});

export default LifeWithHypsiesScreen;
